svg.script:
    window.onload=function () {
		var colorSelected = "#F7FE2E";
		var bodyPart = document.getElementsByClassName("bodyPart");
		var currentFill = '';
		var currentId = '';
		var lastId = '';
		var lastFill = '';

		var tapEvent = function() {
		    var currentIdSelected = this.getAttribute("id");

		    if(currentIdSelected != 'cuerpo_2_'){

		    	if(lastId != currentIdSelected){
		    		// --------------------------------------------
		    		// CONDITION FOR RESTORE COLOR FILL OF LAST ID
		    		// --------------------------------------------
		    		if(lastId != ''){
		    			restoreColorById(lastId);
		    		}

		    		// --------------------------------------------
		    		// SET NEW FILL COLOR TO ITEM SELECTED
		    		// --------------------------------------------
		    		this.setAttribute("fill", colorSelected);

		    		// --------------------------------------------
		    		// SAVE LAST ID SELECTED
		    		// --------------------------------------------
		    		lastId = currentIdSelected;

		    		// --------------------------------------------
		    		// RETURN CURRENT ITEM SELECT
		    		// --------------------------------------------
		    		alert(currentIdSelected);
		    	}
		    }
		};

		function restoreColorById(idPart){
			switch(idPart) {
			    case 'bazo_1_':
			    	document.getElementById(idPart).setAttribute('fill', '#2AA8CF');
			        break;
			    case 'cerebro_3_':
			    	document.getElementById(idPart).setAttribute('fill', '#21B3D6');
			        break;
			    case 'pulmones_2_':
			    	document.getElementById(idPart).setAttribute('fill', '#21B3D6');
			    	break;
				case 'corazon_2_':
					document.getElementById(idPart).setAttribute('fill', '#8015B8');
					break;			   
			    case 'higado_2_':
					document.getElementById(idPart).setAttribute('fill', '#8015B8');
			    	break;
			    case 'estomago_2_':
					document.getElementById(idPart).setAttribute('fill', '#B31C9E');
			    	break;
			    case 'intestinos_2_':
			    	document.getElementById(idPart).setAttribute('fill', '#21B3D6');
			    	break;
			    default:
			        break;
			} 
		}

		for (var i = 0; i < bodyPart.length; i++) {
		    bodyPart[i].addEventListener('click', tapEvent, false);
		}


	}
